INSERT INTO `wp_comments` VALUES (1,1,'A WordPress Commenter','wapuu@wordpress.example','https://wordpress.org/','','2021-10-06 10:12:33','2021-10-06 10:12:33','Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\">Gravatar</a>.',0,'1','','comment',0,0),(2,100,'Generate Income','75089@gmail.com','','141.138.182.195','2021-11-01 16:21:42','2021-11-01 16:21:42','Heres How TOP 1% Of Marketers Make Profits\r\n\r\nHey,\r\n\r\nDid you know that Online Learning is the quickest growing market in the education industry with a whopping 900% growth rate since 2000?\r\n\r\nYouve already left a lot of money on the table (and are leaving even more with each passing day) if you havent tapped into this market.\r\n\r\nClick here to see how the TOP MARKETERS are doing it. https://bit.ly/Generate_Income',0,'0','Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.114 Safari/537.36','comment',0,0),(3,1,'BobbiBrown.co.uk','kimberly.garcia@gmail.com','https://is.exospecial.com/bobbibrown.co.uk','185.213.27.108','2022-01-07 09:25:32','2022-01-07 09:25:32','Great content!  Keep up the good work!',0,'0','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/92.0.4515.131 Safari/537.36','comment',0,0);
